import React from 'react';

function ProgressBar() {
  return (
    <section id="skills">
      <h2>Skills</h2>
      <div style={{ width: '50%', margin: '0 auto' }}>
        <span>HTML/CSS</span>
        <progress value="90" max="100" style={{ width: '100%', backgroundColor: '#4CAF50' }}></progress>
      </div>
      <div style={{ width: '50%', margin: '0 auto' }}>
        <span>JavaScript</span>
        <progress value="80" max="100" style={{ width: '100%', backgroundColor: '#4CAF50' }}></progress>
      </div>
      <div style={{ width: '50%', margin: '0 auto' }}>
        <span>React</span>
        <progress value="70" max="100" style={{ width: '100%', backgroundColor: '#4CAF50', borderRadius: '6px' }}></progress>
      </div>
    </section>
  );
}

export default ProgressBar;
